import Head from 'next/head'
import styles from '../styles/Home.module.css'
import Recipe from '../components/recipe'
import { getAllRecipes, getNutrientsForProduct } from '../lib/api'

export default function Home({recipes}) {


  return (
    <div className={styles.container}>
      <Head>
        <title>Olofsbaljor</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
      <div>
        <h1> V채lkommen till Olofs baljor</h1>
        <p> Detta 채r en sida inneh책llande mina favorit baljv채xtrecept</p>
      </div>
      <h2>Baljor</h2>
      <ul>
      { recipes.length > 0 ? recipes.map(
        r => (
            <li> <a href={"#" + r.fields.title}>{r.fields.title}</a></li>
        )
      ): null }
      </ul>
      { recipes.length > 0 ? recipes.map(
        r => (
          <div>
          <Recipe recipe={r.fields}></Recipe>
          </div>
        )
      ): null
      }
      </div>
)}

export async function getStaticProps() {
  let recipes = await getAllRecipes()
  recipes = recipes.items
  // console.log('recipes', recipes[0].fields.ingredientsRt);
  const ingredients = recipes[0].fields.ingredientsRt
  console.log('recipes', ingredients.content[0].content[0]);
  const key = ingredients.content[0].props.children[0].props.children[0].props.children[1].key
  console.log('Key ', key);


  let nutrients = await getNutrientsForProduct()
  // console.log('nutrients: ', nutrients)

  return {
    props: {recipes, nutrients}
  }
}
